INSERT INTO `page_definitions` VALUES (1, '招聘需求列表', 3, 'import { reactive } from \'vue\';\nimport { message } from \'ant-design-vue\';\n\nconst formData = reactive({\n  name: \'\',\n  account: \'\',\n  status: \'1\',\n  remark: \'\'\n});\n\nconst handleSubmit = () => {\n  if (!formData.name) {\n    message.warning(\'请输入用户名称\');\n    return;\n  }\n  if (!formData.account) {\n    message.warning(\'请输入登录账号\');\n    return;\n  }\n  \n  message.success(\'提交成功: \' + JSON.stringify(formData));\n  // TODO: 调用API保存数据\n};\n\nconst handleCancel = () => {\n  message.info(\'取消操作，返回上一页\');\n  // router.back();\n};', '{\"root\":{\"id\":\"root\",\"type\":\"div\",\"props\":{},\"style\":{\"padding\":\"24px\",\"minHeight\":\"100%\",\"background\":\"#fff\"},\"events\":{},\"children\":[{\"id\":\"comp_gkekkkjh1\",\"type\":\"h2\",\"text\":\"新增/编辑 用户\",\"props\":{},\"style\":{\"marginBottom\":\"24px\",\"borderBottom\":\"1px solid #eee\",\"paddingBottom\":\"16px\"},\"children\":[],\"events\":{}},{\"id\":\"comp_0yvd4qvdv\",\"type\":\"AForm\",\"props\":{\"layout\":\"vertical\",\"labelCol\":{\"span\":6},\"wrapperCol\":{\"span\":18}},\"style\":{\"maxWidth\":\"800px\"},\"events\":{},\"children\":[{\"id\":\"comp_0ps7zbzt9\",\"type\":\"ARow\",\"props\":{\"gutter\":24},\"style\":{},\"events\":{},\"children\":[{\"id\":\"comp_lgv31d1hb\",\"type\":\"ACol\",\"props\":{\"span\":12},\"style\":{},\"events\":{},\"children\":[{\"id\":\"comp_9nplmmyg1\",\"type\":\"AFormItem\",\"props\":{\"label\":\"用户名称\",\"required\":true},\"style\":{},\"events\":{},\"children\":[{\"id\":\"comp_q593j9y67\",\"type\":\"AInput\",\"props\":{\"placeholder\":\"请输入用户名称\"},\"model\":\"formData.name\",\"style\":{},\"children\":[],\"events\":{}}]}]},{\"id\":\"comp_gxgjd926f\",\"type\":\"ACol\",\"props\":{\"span\":12},\"style\":{},\"events\":{},\"children\":[{\"id\":\"comp_clx1mg5xb\",\"type\":\"AFormItem\",\"props\":{\"label\":\"登录账号\",\"required\":true},\"style\":{},\"events\":{},\"children\":[{\"id\":\"comp_uotn5clc1\",\"type\":\"A