INSERT INTO `sales_process_rule` VALUES ('59c9a479870040e484e3dc5076243bed', '商机报备与保护制度', '1. 所有新接触客户必须在24小时内录入CRM系统，否则视为公共资源。\n2. 报备有效期为3个月，期间其他销售人员不得跟进。\n3. 若3个月内无实质性进展（阶段未推进），系统将自动释放至公海池。\n4. 跨区域撞单情况，以系统最早录入时间为准。', '2026-01-04 20:48:21.933347');
INSERT INTO `sales_process_rule` VALUES ('796b4323847e4032862c49a434d63e97', '客户接待标准流程', '1. 预约：确认客户来访人数、职位、关注点，提前预定会议室。\n2. 接待：前台登记，引导至会议室，提供茶水（矿泉水/茶/咖啡）。\n3. 演示：连接投影仪，准备好演示环境，演示时长控制在30分钟内。\n4. 送别：送至电梯口或公司门口，并在当天发送感谢短信/邮件。', '2026-01-04 20:48:21.933347');
INSERT INTO `sales_process_rule` VALUES ('a1b2c3d4e5f6789012345678', '客户分级管理制度', '1. A类客户（年采购额>100万）：专属销售经理对接，季度拜访，优先服务。\n2. B类客户（年采购额50-100万）：区域销售负责，半年度拜访，常规服务。\n3. C类客户（年采购额<50万）：电话维护为主，年度评估升级机会。\n4. 客户级别每半年评估一次，根据最近12个月采购额调整。', '2026-01-06 22:14:24.000000');
INSERT INTO `sales_process_rule` VALUES ('a7b8c9d0e1f2a3b4c5d6e7f8a9b0c1d2', '销售日报管理规范', '1. 报送时间：每日17:00前提交销售日报，逾期未报视为缺勤。\n2. 内容要求：当日拜访客户数量、新增商机、重点进展、次日计划。\n3. 数据真实性：严禁虚报、漏报、延报，发现虚假信息视情节轻重处罚。\n4. 汇总分析：销售经理每周一汇总上周日报，周一例会通报重点问题。\n5. 存档要求：日报保存期限2年，作为绩效考核和晋升参考依据。', '2026-01-06 22:17:28.000000');
INSERT INTO `sales_process_rule` VALUES ('b2c3d4e5f678901234567890a1', '价格折扣审批权限', '1. 销售人员：可给予不超过5%的折扣。\n2. 销售经理：可给予不超过10%的折扣。\n3. 销售总监：可给予不超过15%的折扣。\n4. 超过15%折扣需总经理审批，并提供竞争对手报价证明。\n5. 严禁跨级折扣，必须逐级审批。', '2026-01-06 22:14:24.000000');
INSERT INTO `sales_process_rule` VALUES ('b8c9d0e1f2a3b4c5d6e7f8a9b0c1d2e3', '销售离职交接管理', '1. 交接启动：离职申请批准后立即启动交接流程，交接期不少于2周。\n2. 客户资料：所有客户信息、联系方式、拜访记录、跟进历史需完整移交给接手人。\n3. 商机状态：进行中的商机需说明进展、关键决策人、下一步计划，协助完成过渡。\n4. 合同款项：未回款合同需移交相关文件，协助催收到账。\n5. 交接验收：交接完成后填写《离职交接清单》，由销售经理签字确认后方可办理离职手续。', '2026-01-06 22:17:41.000000');
INSERT INTO `sales_process_rule` VALUES ('c3d4e5f678901234567890a1b2c3', '招投标管理规范', '1. 标书制作：至少提前5个工作日启动技术部支持，预留修改时间。\n2. 标书审核：技术审核->商务审核->法务审核->最终定稿。\n3. 投标现场：至少两人到场，一人主讲，一人记录竞争者情况。\n4. 中标公示后24小时内上报公司备案，领取中标通知书。\n5. 未中标项目需在3天内组织复盘，分析原因并总结经验。', '2026-01-06 22:14:24.000000');
INSERT INTO `sales_process_rule` VALUES ('d4e5f678901234567890a1b2c3d4e5', '售后服务响应标准', '1. 故障报修：30分钟内响应，2小时内到达现场（同城）。\n2. 质保期内：免费维修更换配件，48小时内解决故障。\n3. 质保期外：提供报价单，客户确认后24小时派遣技术人员。\n4. 投诉处理：接到投诉后1小时内联系客户，24小时内给出处理方案。\n5. 定期回访：项目验收后1个月、3个月、6个月主动回访。', '2026-01-06 22:14:24.000000');
INSERT INTO `sales_process_rule` VALUES ('def3b01c3d2f4c9c92b366c275c3cf8b', '合同审批及盖章规范', '1. 标准合同（金额<50万）：销售经理审批 -> 财务审批 -> 法务备案 -> 用印。\n2. 非标合同或金额>=50万：销售总监审批 -> 财务总监审批 -> 法务总监审批 -> 总经理审批 -> 用印。\n3. 所有合同必须附带技术协议附件。\n4. 严禁先盖章后签字。', '2026-01-04 20:48:21.933347');
INSERT INTO `sales_process_rule` VALUES ('e5f6a7b8c9d0e1f2a3b4c5d6e7f8a9b', '样品申请与管理制度', '1. 样品申请：需填写《样品申请单》，注明客户信息、产品型号、数量、用途。\n2. 审批流程：销售经理审批 -> 库房核对库存 -> 财务确认押金 -> 发货。\n3. 收费标准：常规样品收取30%押金，特殊定制样品收取50%押金，成交后退还。\n4. 发货与跟踪：样品发出后3天内确认客户签收，15天内跟进使用反馈。\n5. 未成交处理：30天内未成交，销售经理跟进确认意向，超期未成交转为呆滞库存。', '2026-01-06 22:17:28.000000');
INSERT INTO `sales_process_rule` VALUES ('f047edd100c742bcab7408229039774a', '销售提成发放细则', '1. 提成计算基数：以实际回款金额为准（不含税）。\n2. 发放节点：回款次月发放50%，项目验收后发放剩余50%。\n3. 离职员工未结提成：已回款部分按正常比例发放，未回款部分不再计提。\n4. 季度销售冠军额外奖励1%提成点。', '2026-01-04 20:48:21.933347');
INSERT INTO `sales_process_rule` VALUES ('f6b7c8d9e0f1a2b3c4d5e6f7a8b9c0d', '客户投诉处理流程', '1. 投诉受理：接到投诉后1小时内登记台账，明确投诉类型、紧急程度。\n2. 初步调查：24小时内联系客户了解详情，同步相关部门核实情况。\n3. 处理方案：48小时内提出解决方案，经销售总监审批后回复客户。\n4. 执行跟踪：问题解决后3天内回访客户满意度，记录处理结果。\n5. 归档与改进：每月分析投诉数据，找出共性问题，推动流程改进。', '2026-01-06 22:17:28.000000');
