INSERT INTO `sales_product_doc` VALUES ('a415a11eae2c4ad28e4adfc726485c65', '企业数字化转型解决方案(制造业版).pptx', '15.8 MB', '/files/docs/solution_manufacturing.pptx', '2025-12-15 20:48:21.933347');
INSERT INTO `sales_script` VALUES ('259d889848ed432384a5e87f7c045cd6', '产品核心优势介绍（30秒电梯演讲）', '[销售] 我们的OMS系统有三大核心优势：第一是全流程一体化，打通了从CRM到ERP再到财务的全链路；第二是高度可配置，90%的业务变更无需写代码；第三是极致的用户体验，界面简洁易用，员工上手无需培训。\n[客户] 听起来功能很全面，但具体能解决什么问题呢？\n[销售] 这些优势能直接为您解决数据孤岛和系统维护成本高的问题。比如，很多公司因为系统不互通，需要人工重复录入数据，我们系统打通后，数据自动同步，工作效率至少提升50%。\n[客户] 那实施起来复杂吗？\n[销售] 不复杂的。我们提供完整的实施服务，从需求调研到上线培训全程跟进，通常3-4周就能完成。要不要我发几个成功案例给您看看？', '产品介绍', '2026-01-04 20:48:21.933347', '30秒快速介绍产品核心价值，激发客户兴趣');
INSERT INTO `sales_script` VALUES ('80a2f3d2f7b74490960a2e7433297cf4', '邀约客户考察话术', '[销售] 为了让您更直观地了解系统如何落地，诚挚邀请您下周二来我们公司参观考察。\n[客户] 参观考察啊，我需要准备什么吗？\n[销售] 不需要特意准备。届时我们的技术总监会亲自为您演示最新版本，并且您可以和我们的产品团队直接交流您的定制化需求。\n[客户] 好的，那参观大概需要多长时间？\n[销售] 大概半天时间。我们会安排系统演示、案例分享和需求交流三个环节。您看上午10点还是下午2点比较方便？\n[客户] 上午10点吧，我下午还有个会。\n[销售] 没问题，那我今天下午把会议邀请发给您，地址和流程都在里面。期待和您见面！', '客户邀约', '2026-01-04 20:48:21.933347', '邀请客户到公司实地考察，增强信任感');
INSERT INTO `sales_script` VALUES ('a0dc123f-eb07-11f0-ac57-00163e02a865', '客户需求挖掘', '[销售] 咱们公司目前在销售管理上主要遇到什么痛点吗？\n[客户] 主要是客户信息分散，销售数据不好统计。\n[销售] 这个问题很多企业都遇到过。我们的系统可以把客户信息统一管理，而且能自动生成销售报表，实时查看业绩。\n[客户] 报表能自定义吗？\n[销售] 当然可以，支持拖拽式配置，您可以根据管理需求自由组合字段。要不要我给您演示一下？', '需求分析', '2026-01-06 21:57:24.000000', '深入了解客户痛点，挖掘真实需求');
INSERT INTO `sales_script` VALUES ('a4e315d7-eb07-11f0-ac57-00163e02a865', '产品演示开场', '[销售] 今天主要给您演示三个核心功能：客户管理、订单跟进和业绩分析。每个功能都会结合您的实际业务场景来展示。\n[客户] 好的，从哪个开始？\n[销售] 先看客户管理，这是销售的基础。您看，这个界面可以360度展示客户信息，包括历史沟通记录、合同、订单等。\n[客户] 这个看起来确实很直观。\n[销售] 对的，而且支持多维度筛选和搜索，找客户特别快。', '产品演示', '2026-01-06 21:57:31.000000', '产品演示前的开场白，为演示做铺垫');
INSERT INTO `sales_script` VALUES ('a65d2081f7844f439f326e0d10c6452b', '通用电话开场白', '[销售] 您好，我是[公司名]的销售顾问[姓名]，打扰您两分钟。\n[客户] 有什么事快说。\n[销售] 我们公司专注于为企业提供数字化转型解决方案，近期我们服务了[知名同行企业]，帮助他们提升了30%的运营效率。想请教一下贵公司在信息化管理方面目前主要关注哪些领域呢？\n[客户] 我们最近确实在考虑升级系统，主要是现在数据太分散了。\n[销售] 数据分散确实是个大问题，很多企业都面临这个挑战。我们的OMS系统正好可以打通各个业务环节数据，实现全流程可视化管理。我可以给您发一份产品资料吗？\n[客户] 好的，发我看看。\n[销售] 没问题，我今天就发给您。另外，如果方便的话，这周或下周约个时间，我给您做个详细的演示？', '初次接触', '2026-01-04 20:48:21.933347', '电话初次接触客户的标准化开场白，建立对话');
INSERT INTO `sales_script` VALUES ('a75ba9e7-eb07-11f0-ac57-00163e02a865', '建立长期合作关系', '[销售] 我们不只是卖产品，更希望成为您的长期合作伙伴。\n[客户] 这话怎么说？\n[销售] 我们会定期回访，了解系统使用情况，根据业务发展持续优化功能。另外还有专属的客户成功经理，随时为您解决问题。\n[客户] 听起来服务挺到位的。\n[销售] 是的，我们把客户成功放在第一位，只有您用得好，我们才算成功。', '客户关系', '2026-01-06 21:57:35.000000', '强调长期合作理念，建立信任');
INSERT INTO `sales_script` VALUES ('a9c63edc-eb07-11f0-ac57-00163e02a865', '处理客户拖延签约', '[销售] 关于合同的事，我看您这边还在考虑，是有什么顾虑吗？\n[客户] 还在和其他产品对比。\n[销售] 理解，对比是应该的。不过我想提醒一点，早上线一天，就能早一天享受效率提升。我们的很多客户都说，后悔没有早点用。\n[客户] 嗯...\n[销售] 我可以把我们客户的真实反馈案例发给您，您看看他们的实际效果？', '促成签约', '2026-01-06 21:57:39.000000', '应对客户拖延，创造紧迫感');
INSERT INTO `sales_script` VALUES ('ba801077-eb07-11f0-ac57-00163e02a865', '处理客户说回去考虑一下', '[销售] 好的，那我帮您总结一下今天沟通的重点：第一，系统能打通您各部门数据；第二，能提升30%效率；第三，实施周期4周。您还有其他顾虑吗？\n[客户] 好像没有了。\n[销售] 那您回去考虑时，重点关注哪几点呢？\n[客户] 主要是成本和实施难度。\n[销售] 我把这两个方面的详细资料发给您，包括ROI分析和实施案例，这样您和团队讨论时更充分。明天我再来联系您？', '异议处理', '2026-01-06 21:58:07.000000', '客户说要考虑时的标准化回应');
INSERT INTO `sales_script` VALUES ('bd0cac5b-eb07-11f0-ac57-00163e02a865', '介绍行业成功案例', '[销售] 我们在您这个行业服务了不少客户，比如XX公司，用了我们系统后，订单处理效率提升了50%，客户投诉下降了60%。\n[客户] 他们是什么时候上线的？\n[销售] 去年6月，现在已经稳定运行一年多了。\n[客户] 能不能安排参观交流？\n[销售] 这个没问题，我可以帮您联系，组织一次交流学习，您看可以吗？', '案例介绍', '2026-01-06 21:58:11.000000', '用行业成功案例增强说服力');
INSERT INTO `sales_script` VALUES ('c5d6e135-eb07-11f0-ac57-00163e02a865', '老客户回访话术', '[销售] 王总，打扰您几分钟。您用我们系统3个月了，感觉怎么样？\n[客户] 还可以，比之前好多了。\n[销售] 有没有什么需要优化或者不太满意的地方？\n[客户] 倒是有个想法，报表如果能导出Excel就好了。\n[销售] 这个建议非常好，我们下个版本就会加上。感谢您的反馈，我记录下来。\n[客户] 谢谢你们的重视。', '客户维护', '2026-01-06 21:58:26.000000', '定期回访老客户，收集反馈');
INSERT INTO `sales_script` VALUES ('c939f612-eb07-11f0-ac57-00163e02a865', '介绍售后服务', '[销售] 我们的服务不只是系统上线就结束了，还包括7x24小时技术支持、定期系统优化和免费版本升级。\n[客户] 如果出了问题怎么处理？\n[销售] 我们有专业的技术团队，一般问题2小时内响应，24小时内解决。重大问题会立即启动应急预案。\n[客户] 服务有保障吗？\n[销售] 我们在合同里明确了服务等级协议（SLA），承诺了响应时间和解决时效，保障您的业务稳定运行。', '售后服务', '2026-01-06 21:58:32.000000', '介绍完整的售后服务体系');
INSERT INTO `sales_script` VALUES ('d4423fbb-eb07-11f0-ac57-00163e02a865', '处理客户说太贵了', '[销售] 理解您的预算考量。不过价格包含了什么？包含系统、实施、培训和一年的服务。\n[客户] 能不能再优惠点？\n[销售] 价格已经是我们最有诚意的方案了。但考虑到长期合作，我可以申请送您3个月的免费服务期，相当于折扣了8%。\n[客户] 这个可以考虑。\n[销售] 而且您可以分期付款，减轻资金压力。这样如何？', '价格谈判', '2026-01-06 21:58:50.000000', '处理价格异议的多种策略');
INSERT INTO `sales_script` VALUES ('eaef44ea-eb07-11f0-ac57-00163e02a865', '介绍系统安全性', '[销售] 关于数据安全，我们采用了银行级别的防护体系。\n[客户] 具体怎么保障的？\n[销售] 第一，数据传输采用SSL加密；第二，存储采用多重加密和异地备份；第三，所有操作都有审计日志，可追溯；第四，通过等保三级认证。\n[客户] 听起来挺安全的。\n[销售] 是的，很多银行和金融机构都在用我们的系统，安全是底线要求。', '安全介绍', '2026-01-06 21:59:28.000000', '详细介绍系统的安全保障措施');
INSERT INTO `sales_script` VALUES ('fca4d42742d3462daadbc543e2385cf0', '竞品对比回应（针对某友商）', '[客户] 某友商的财务软件好像也很厉害，你们相比有什么优势？\n[销售] 友商在财务软件领域确实很知名，这点我们非常认可。\n[客户] 那为什么选你们不选他们呢？\n[销售] 在业务运营（OMS）这块，我们的架构更灵活，更贴合当下互联网+的业务模式。例如在多渠道订单归集和复杂的库存调度策略上，我们是原生支持的，而他们可能需要大量的二次开发。\n[客户] 二次开发的话成本会很高吧？\n[销售] 是的，而且开发周期长。我们的开箱即用功能可以帮您节省这部分投入。我可以给您做个功能对比表，您看可以吗？\n[客户] 可以，发来看看吧。', '竞品分析', '2026-01-04 20:48:21.933347', '应对客户提出竞品对比时的专业回应');
INSERT INTO `sales_script` VALUES ('fd86fbc73dbd4352aae3d48aad3b4e8f', '价格异议处理话术', '[客户] 你们的价格有点高啊，比我们预算超了不少。\n[销售] 非常理解您对预算的考量。\n[客户] 能不能便宜点？\n[销售] 不过，单纯看价格可能不够全面，我们更建议看投入产出比（ROI）。我们的系统虽然初期投入稍高，但由于采用了自动化流程，预计每年能为您节省人工成本约50万元，系统上线半年即可收回成本。\n[客户] 50万？这个数字是怎么算出来的？\n[销售] 我可以给您做一个详细的ROI分析报告，包括人力成本、效率提升、错误减少等多个维度的量化分析。您看我们需要和您哪些部门配合来获取准确的数据？\n[客户] 好的，那你做出来给我看看。', '异议处理', '2026-01-04 20:48:21.933347', '处理客户对价格的异议，强调ROI价值');
